{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:33:\"The Month in WordPress: July 2021\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:68:\"https://wordpress.org/news/2021/08/the-month-in-wordpress-july-2021/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 03 Aug 2021 13:53:13 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:18:\"Month in WordPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:35:\"https://wordpress.org/news/?p=11107\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:334:\"WordPress is global in reach and open source in nature. And you would assume that what allows the software to be used by anyone would also enable it to be built by anyone. After all, your location doesn’t matter, and who employs you also doesn’t matter. And your relative social standing certainly shouldn’t matter. As [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Hari Shanker R\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:15215:\"\n<blockquote class=\"wp-block-quote\"><p>WordPress is global in reach and open source in nature. And you would assume that what allows the software to be used by anyone would also enable it to be built by anyone. After all, your location doesn’t matter, and who employs you also doesn’t matter. And your relative social standing certainly shouldn’t matter. As long as you can communicate with the others contributing to the project, there should be no obstacle to your participation.</p></blockquote>\n\n\n\n<p class=\"has-drop-cap\">That was <a href=\"https://profiles.wordpress.org/chanthaboune/\">Josepha Haden</a> on the “<a href=\"https://wordpress.org/news/2021/07/episode-13-cherishing-wordpress-diversity/\">Cherishing WordPress Diversity</a>” episode of the <a href=\"https://wordpress.org/news/podcast/\">WP Briefing Podcast</a>, speaking about the importance of diversity, equity, and inclusion within the fabric of the WordPress project. Her statement captures the spirit of the WordPress open source project, and we hope it resonates with you. Now, let&#8217;s dive in!</p>\n\n\n\n<hr class=\"wp-block-separator\" />\n\n\n\n<h2>Say hello to WordPress 5.8</h2>\n\n\n\n<p>WordPress <a href=\"https://wordpress.org/news/2020/12/simone/\">version 5.8</a>, “Tatum,” came out on July 20. Version 5.8 is a major release that offers features like block-based widgets, a host of new blocks and patterns, a template editor, a duotone feature to stylize images, theme.json, and support for webP images, to name a few. Read more in the <a href=\"https://wordpress.org/news/2021/07/tatum/\">release post</a>, the <a href=\"https://make.wordpress.org/core/2021/07/03/wordpress-5-8-field-guide/\">field guide</a>, and the <a href=\"https://make.wordpress.org/community/2021/06/18/meetup-group-resources-talking-points-for-wordpress-5-8/\">talking points post for meetup groups</a>. </p>\n\n\n\n<p>Want to contribute to WordPress core?&nbsp;</p>\n\n\n\n<ul><li>Join the&nbsp; <a href=\"https://wordpress.slack.com/archives/C02RQBWTW\">#core</a> channel, follow the <a href=\"https://make.wordpress.org/core/\">Core Team blog</a>, and check out the <a href=\"https://make.wordpress.org/core/handbook/\">team handbook</a>. Don’t miss the Core Team chats on Wednesdays at <a href=\"https://www.timeanddate.com/worldclock/fixedtime.html?hour=5&amp;min=00&amp;sec=0\">5 AM</a> and <a href=\"https://www.timeanddate.com/worldclock/fixedtime.html?hour=20&amp;min=00&amp;sec=0\">8 PM</a> UTC.</li><li><a href=\"https://translate.wordpress.org/\">Translate WordPress</a> to your local language &#8211; here’s the <a href=\"https://make.wordpress.org/polyglots/2021/07/09/wordpress-5-8-translation-status-july-9-2020/\">latest translation status</a>.</li><li>Contact the Marketing Team in the <a href=\"https://wordpress.slack.com/archives/C0GKJ7TFA\">#marketing</a> slack channel, if you wish to support <a href=\"https://make.wordpress.org/marketing/2021/07/21/social-media-pack-for-5-8-ongoing-collaborations/\">social media engagement around WordPress 5.8</a>.</li></ul>\n\n\n\n<h2>Gutenberg Version 11.0 is released</h2>\n\n\n\n<p>Contributor teams released the <a href=\"https://make.wordpress.org/core/2021/07/09/whats-new-in-gutenberg-11-0-0-9-july/\">11th version</a> of Gutenberg on July 9. <a href=\"https://make.wordpress.org/core/2021/07/09/whats-new-in-gutenberg-11-0-0-9-july/\">Version 11.0</a>, which focuses heavily on backports and bug fixes, showcases some cool features such as an editing overlay for template parts and reusable blocks, and support for CSS shorthand properties in theme.json and block attributes. <a href=\"https://make.wordpress.org/core/2021/07/21/whats-new-in-gutenberg-11-1-0-21-july/\">Version 11.1</a> was also shipped this month, on July 21. The release adds custom block borders as block supports and adds “drag and drop” to the list view.&nbsp;</p>\n\n\n\n<p>Want to get involved in building Gutenberg? Follow <a href=\"https://make.wordpress.org/core/\">the Core Team blog</a>, contribute to <a href=\"https://github.com/WordPress/gutenberg/\">Gutenberg on GitHub</a>, and join the <a href=\"https://wordpress.slack.com/archives/C02QB2JS7\">#core-editor</a> channel in the <a href=\"https://make.wordpress.org/chat/\">Make WordPress Slack</a>. The “<a href=\"https://make.wordpress.org/core/2021/07/21/whats-next-in-gutenberg-site-editing-status-check-late-july-august-2021/\">What’s next in Gutenberg</a>” post offers more details on the latest updates.&nbsp;</p>\n\n\n\n<h2>Returning to in-person WordPress events</h2>\n\n\n\n<p>The Community Team kicked off work to bring back in-person WordPress events. The team <a href=\"https://make.wordpress.org/community/2021/07/01/in-person-meetup-events-for-vaccinated-community-members/#comment-29654\">recently announced</a> that in-person WordPress meetups can be organized in a region if the local public health authority allows in-person events and if the region passes the in-person<a href=\"https://make.wordpress.org/community/handbook/meetup-organizer/2021-returning-to-in-person-meetups/in-person-meetup-decision-checklist/\"> safety checklist</a>. If the region does not meet guidelines on page one of the <a href=\"https://make.wordpress.org/community/handbook/meetup-organizer/2021-returning-to-in-person-meetups/in-person-meetup-decision-checklist/\">safety checklist</a>, organizers can plan events for fully vaccinated, recently tested (negative), or recently recovered community members. Subsequently, the team also <a href=\"https://make.wordpress.org/community/2021/07/27/proposal-how-to-return-to-safe-in-person-wordcamps/\">shared a proposal for the return to in-person WordCamps</a> in places that meet the <a href=\"https://make.wordpress.org/community/handbook/meetup-organizer/2021-returning-to-in-person-meetups/in-person-meetup-decision-checklist/\">safety guidelines and the vaccination/testing requirements</a>. Please share your feedback on the post if you have any thoughts. For more context, check out the “<a href=\"https://wordpress.org/news/2021/07/episode-12-wordpress-in-person/\">In Person!</a>” episode of the <a href=\"https://wordpress.org/news/podcast/\">WP Briefing Podcast</a>.&nbsp;</p>\n\n\n\n<p>Want to contribute to the Community Team? Follow the <a href=\"https://make.wordpress.org/community/\">Community Team</a> blog, or join them in the <a href=\"https://wordpress.slack.com/archives/C037W5S7X\">#community</a> channel in the Make WordPress Slack.&nbsp;</p>\n\n\n\n<h2>BuddyPress 9.0 is out</h2>\n\n\n\n<p>The BuddyPress team is busy! Within barely a month of their last major release (<a href=\"https://buddypress.org/2021/06/buddypress-8-0-0-alfano/\">version 8.0)</a>, the team shipped <a href=\"https://buddypress.org/2021/07/buddypress-9-0-0-mico/\">version 9.0</a> on July 19. Key features of the release include widget blocks and updates to the BP REST API.&nbsp; Download it from the <a href=\"https://wordpress.org/plugins/buddypress/\">WordPress.org plugin directory</a> or check it out from its <a href=\"https://buddypress.trac.wordpress.org/browser/branches/9.0\">subversion repository.</a> Want to help build BuddyPress? Follow their <a href=\"https://bpdevel.wordpress.com/\">developer relations blog</a>, check out their <a href=\"https://codex.buddypress.org/participate-and-contribute/contribute-with-code/\">handbook page</a>, or join them in the <a href=\"https://wordpress.slack.com/archives/C02RQBYUG\">#buddypress</a> channel in the Make WordPress Slack.</p>\n\n\n\n<h2>WordPress Event updates</h2>\n\n\n\n<ul><li>WordCamp US is coming back on October 1, 2021, <a href=\"https://us.wordcamp.org/2021/wordcamp-us-is-back/\">as a daylong online event</a>!</li><li>Free tickets for <a href=\"https://floripa.wordcamp.org/2021/inscricoes/\">WordCamp Florianopolis</a> (August 11-12) are now available.</li><li>The <a href=\"https://make.wordpress.org/community/tag/wpdiversity/\">Diverse Speaker Training group</a> of the Community Team announced <a href=\"https://make.wordpress.org/community/2021/07/26/announcement-and-call-for-volunteers-expanding-wpdiversity-to-three-programs/\">three new programs</a> for Meetup and WordCamp organizers. Sign up for the <a href=\"https://make.wordpress.org/community/2021/07/30/workshop-august-19-2021-allyship-for-wordpress-event-organizers-amer-emea/\">inaugural allyship program for event organizers</a> on August 19, 2021, at <a href=\"https://www.timeanddate.com/worldclock/fixedtime.html?iso=20210819T1700\">5:00</a> &#8211; <a href=\"https://www.timeanddate.com/worldclock/fixedtime.html?iso=20210819T1900\">7:00 pm</a> UTC!</li><li>The Polyglots Team is planning a <a href=\"https://make.wordpress.org/polyglots/tag/wptranslationday/\">month-long translation day celebration in September 2021</a>, with two weeks of “core events” from September 17 to 30. The team will announce more details on the event shortly, and you <a href=\"https://make.wordpress.org/polyglots/tag/wptranslationday/\">can follow all the latest updates on their P2</a>.&nbsp;</li><li>Stay updated on <a href=\"https://make.wordpress.org/community/events/online/\">online WordPress meetups</a> around the world by following the Marketing Team’s <a href=\"https://www.linkedin.com/company/make-wordpress-marketing-team/\">WordPress Meetup roundup</a> every Monday.&nbsp;</li><li><a href=\"https://santaclarita.wordcamp.org/2021/\">WordCamp Santa Clarita 2021</a> was held online on July 17-18, 2021. The highlight of the event, which had 41 speakers, 19 sponsors, and 672 attendees, was a <a href=\"https://santaclarita.wordcamp.org/2021/schedule/\">dedicated track for WordPress accessibility</a>. Videos of the event will soon be posted on WordPress.tv.</li><li>The Hosting Team organized <a href=\"https://www.meetup.com/wphosting/events/278295555\">their first meetup</a> in June. Check out the <a href=\"https://www.youtube.com/watch?v=V4UCc1Bze5E&amp;t=702s\">event recording</a>.</li></ul>\n\n\n\n<h2>Feedback requests from WordPress contributor teams</h2>\n\n\n\n<p>Please help these WordPress contributor teams by answering their research requests:</p>\n\n\n\n<ul><li>The Core Team has published a <a href=\"https://make.wordpress.org/core/2021/07/28/wordpress-5-8-tatum-retrospective/\">WordPress 5.8 release retrospective</a>. Share your release feedback as <a href=\"https://make.wordpress.org/core/2021/07/28/wordpress-5-8-tatum-retrospective/#respond\">comments on the post</a> or by <a href=\"https://docs.google.com/forms/d/e/1FAIpQLSei8fSLjV0um4hk_1JKwgu-8E6mpNwwxF3j43mInW7lnVOTDw/viewform?usp=sf_link\">filling out this form</a> before August 15. The team is also <a href=\"https://make.wordpress.org/core/2021/07/21/request-for-feedback-updater-proof-of-concept/\">requesting feedback</a> on a “proof of concept” for the new WordPress updater.&nbsp;</li><li>The Training Team wishes to <a href=\"https://make.wordpress.org/training/2021/07/30/learn-wordpress-user-survey-focus-groups/\">find what learners and potential learners would like to see</a> in the <a href=\"https://learn.wordpress.org\">learn.wordpress.org</a> platform. To contribute, please <a href=\"https://www.surveymonkey.com/r/LearnWordPress\">fill out an anonymous survey</a> (by August 13) OR <a href=\"https://forms.gle/jdk2qkkvGyszx1SG6\">join a short video call</a> to share feedback (on the week of August 2-6).</li><li>The Polyglots Team <a href=\"https://make.wordpress.org/polyglots/2021/07/19/polyglots-training-ready-for-testing/\">announced</a> that “Polyglots Training” (a course to help WordPress translators and communities) is now available for testing. <a href=\"https://make.wordpress.org/polyglots/2021/07/19/polyglots-training-ready-for-testing/\">Sign up now</a>!</li><li>The Test Team wants to<a href=\"https://make.wordpress.org/test/2021/07/30/help-shape-the-future-of-theme-design/\"> hear from theme authors</a> on how they use theme.json in order to shape its future. Help them by <a href=\"https://wordpressdotorg.survey.fm/block-theme-author-feedback\">filling out this survey</a> on or before August 13.</li><li>The Marketing Team is doing research on building engagement around WordPress releases. Please help the team by filling out <a href=\"https://forms.gle/4QFhX8fcNxKAfK8y5\">this quick, two-question survey</a> on how you search for release information. If you have any favorite features from the latest release (WordPress 5.8) let the team know by completing this <a href=\"https://docs.google.com/forms/d/e/1FAIpQLSd_2llymf79-h5sgTiprz7Kw4Gr4cbDHh-AAdAQfiArXlHksg/viewform\">short form</a>.</li></ul>\n\n\n\n<hr class=\"wp-block-separator\" />\n\n\n\n<h2>Further reading</h2>\n\n\n\n<ul><li>The Meta Team launched the new <a href=\"https://make.wordpress.org/meta/2021/07/20/the-wordpress-pattern-directory-is-live/\">WordPress Pattern Directory</a> alongside the 5.8 release. The Design Team also contributed to this project, working with contributors on <a href=\"https://make.wordpress.org/design/2021/07/29/initial-patterns-for-the-patterns-directory-launched/\">launching around 85 block patterns in the directory</a>.</li><li>Check out the following blog posts from the Design Team: <a href=\"https://make.wordpress.org/design/2021/07/13/a-walk-around-the-search-block/\">A Walk Around: The Search Block</a> and <a href=\"https://make.wordpress.org/design/2021/07/27/widgets-in-wordpress-5-8-and-beyond/\">Widgets on 5.8 and beyond</a>. Join their <a href=\"https://make.wordpress.org/design/?s=show+and+tell\">Show and Tell meetings</a> on the last Wednesday of each month to learn about updates on their latest projects and new ideas.</li><li>Check out <a href=\"https://wordpress.org/news/2021/07/configuring-theme-design-with-theme-json/\">this blog post</a> to learn how to configure theme design with theme.json.&nbsp;</li><li>The Test Team has put out a <a href=\"https://make.wordpress.org/test/2021/07/20/test-team-reps-call-for-nominations/\">call for team-rep nominations</a>.</li><li>The Themes Team is in the process of discussing <a href=\"https://make.wordpress.org/themes/2021/07/20/discussion-request-for-feedback-on-requirement-changes/\">updated theme directory guidelines</a>.</li><li>Version 17.9 of WordPress for <a href=\"https://make.wordpress.org/mobile/2021/07/27/call-for-testing-wordpress-for-android-17-9/\">Android</a> and <a href=\"https://make.wordpress.org/mobile/2021/07/28/call-for-testing-wordpress-for-ios-17-9/\">iOS</a> are now available for testing.</li></ul>\n\n\n\n<p><em>Have a story that we should include in the next “Month in WordPress” post? Please </em><a href=\"https://make.wordpress.org/community/month-in-wordpress-submissions/\"><em>submit it using this form</em></a><em>.&nbsp;</em></p>\n\n\n\n<p><em>The following folks contributed to July’s Month in WordPress:  <a href=\'https://profiles.wordpress.org/webcommsat/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>webcommsat</a> <a href=\'https://profiles.wordpress.org/chaion07/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>chaion07</a> <a href=\'https://profiles.wordpress.org/jillbinder/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>jillbinder</a> <a href=\'https://profiles.wordpress.org/lmurillom/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>lmurillom</a> <a href=\'https://profiles.wordpress.org/meher/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>meher</a></em></p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:30:\"com-wordpress:feed-additions:1\";a:1:{s:7:\"post-id\";a:1:{i:0;a:5:{s:4:\"data\";s:5:\"11107\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:1;a:6:{s:4:\"data\";s:58:\"\n		\n		\n		\n		\n		\n				\n		\n\n					\n										\n					\n		\n		\n\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:4:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:61:\"WP Briefing: Episode 14: The Art and Science of Accessibility\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:83:\"https://wordpress.org/news/2021/08/episode-14-the-art-and-science-of-accessibility/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 02 Aug 2021 12:00:00 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:11:\"wp-briefing\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:53:\"https://wordpress.org/news/?post_type=podcast&p=11096\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:463:\"In this episode, Josepha Haden Chomphosy discusses the nuances of building accessible software, the differences between access, usability, and accessibility, and how this all applies to the WordPress project. Have a question you’d like answered? You can submit them to&#160;wpbriefing@wordpress.org, either written or as a voice recording. Credits Editor:&#160;Dustin Hartzler Logo:&#160;Beatriz Fialho Production:&#160;Chloé Bringmann Transcription: [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:9:\"enclosure\";a:1:{i:0;a:5:{s:4:\"data\";s:0:\"\";s:7:\"attribs\";a:1:{s:0:\"\";a:3:{s:3:\"url\";s:60:\"https://wordpress.org/news/files/2021/07/WP-Briefing-014.mp3\";s:6:\"length\";s:1:\"0\";s:4:\"type\";s:0:\"\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:17:\"Nicholas Garofalo\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:9393:\"\n<p>In this episode, Josepha Haden Chomphosy discusses the nuances of building accessible software, the differences between access, usability, and accessibility, and how this all applies to the WordPress project.</p>\n\n\n\n<p><em><strong>Have a question you’d like answered? You can submit them to&nbsp;<a href=\"mailto:wpbriefing@wordpress.org\">wpbriefing@wordpress.org</a>, either written or as a voice recording.</strong></em></p>\n\n\n\n<h2>Credits</h2>\n\n\n\n<ul><li>Editor:&nbsp;<a href=\"https://profiles.wordpress.org/dustinhartzler/\">Dustin Hartzler</a></li><li>Logo:&nbsp;<a href=\"https://profiles.wordpress.org/beafialho/\">Beatriz Fialho</a></li><li>Production:&nbsp;<a href=\"https://profiles.wordpress.org/cbringmann/\">Chloé Bringmann</a></li><li>Transcription: <a href=\"https://profiles.wordpress.org/eidolonnight/\">Nicholas Garofalo</a></li><li>Song: Fearless First by Kevin MacLeod</li></ul>\n\n\n\n<h2>References</h2>\n\n\n\n<ul><li><a href=\"https://wordpress.org/about/accessibility/\">About WordPress Accessibility</a></li><li><a href=\"https://make.wordpress.org/accessibility/\">Make WordPress Accessibility Team</a></li><li><a href=\"https://twitter.com/wpaccessibility\">WordPress Accessibility Team Twitter</a></li><li><a href=\"https://make.wordpress.org/accessibility/handbook/best-practices/\">WordPress Accessibility Handbook</a></li><li><a href=\"https://developer.wordpress.org/coding-standards/wordpress-coding-standards/accessibility/\">Accessibility Coding Standards</a></li><li><a href=\"https://www.w3.org/WAI/intro/wcag\">Web Content Accessibility Guidelines (WCAG)</a></li><li><a href=\"https://www.a11yproject.com/checklist/\">A11y Checklist</a></li><li><a href=\"https://en.wikipedia.org/wiki/Digital_divide\">The Digital Divide</a></li></ul>\n\n\n\n<h2>Transcript</h2>\n\n\n\n<span id=\"more-11096\"></span>\n\n\n\n<p>[contemporary intro music]</p>\n\n\n\n<p><strong>Josepha Haden Chomphosy</strong> 0:10</p>\n\n\n\n<p>Hello, everyone, and welcome to the WordPress Briefing, the podcast where you can catch quick explanations of the ideas behind the WordPress open source project, some insight into the community that supports it, and get a small list of big things coming up in the next two weeks. I&#8217;m your host, Josepha Haden Chomphosy. Here we go.</p>\n\n\n\n<p>[musical interlude]</p>\n\n\n\n<p><strong>Josepha Haden Chomphosy</strong> 0:28</p>\n\n\n\n<p>This is the second of my big scary topics for this month. I&#8217;ll be talking about accessibility, which much like Diversity, Equity and Inclusion, or DEI in the last episode, is one of those areas where the work is never finished. Also, like DEI in last episode, I feel strongly about accessibility and the need for accessible experiences in the world, but I&#8217;m aware that this is an area where I&#8217;m still learning.</p>\n\n\n\n<p><strong>Josepha Haden Chomphosy</strong> 1:04</p>\n\n\n\n<p>WordPress has both an accessibility statement and team, which makes a lot of sense given that the software supports so many different people, and industries, and cultures. But if you&#8217;re not quite bought into the idea that software should be accessible, or that accessible software can&#8217;t also be usable, then this is the episode for you.</p>\n\n\n\n<p><strong>Josepha Haden Chomphosy</strong> 1:25</p>\n\n\n\n<p>Before I joined the WordPress project, the majority of my work with accessibility was in the context of the digital divide. Now, when talking about the digital divide, there are three concepts around quote-unquote, &#8220;getting things to people,&#8221; and those are access, usability, and accessibility. Sometimes these words seem interchangeable, but ultimately they have nuanced differences that address different problems. And I like to think of them this way.</p>\n\n\n\n<p>Access is making sure that someone can obtain something.</p>\n\n\n\n<p>Usability is making sure that the user experience is understandable or coherent.</p>\n\n\n\n<p>And accessibility is making sure that it&#8217;s usable by the largest number of people.</p>\n\n\n\n<p>I have always considered each as a subset of the one that came before it. So having something everyone can access is good, but easy to access and easy to use is better. Easy to use is good, but easy to use and easily accessible is better.</p>\n\n\n\n<p><strong>Josepha Haden Chomphosy</strong> 2:27</p>\n\n\n\n<p>After joining WordPress, I discovered that accessibility in the context of software building is well, substantially more complicated. There&#8217;s no such thing as perfect accessibility, or a site that is 100% accessible, and many aspects are pretty open to interpretation. It turns out that accessibility, like so many things in WordPress, is a complicated intersection of art and science.</p>\n\n\n\n<p>As an example, there&#8217;s a rule that says, &#8220;Ensure that links are recognizable as links.&#8221; A fast shorthand to accomplish that, that we see all over the internet, is to underline all links or put that icon next to it that says, &#8220;This opens in a new tab.&#8221; You know that icon that&#8217;s a box with an arrow? That definitely has a name, that I definitely don&#8217;t know? That icon. [laughing] But those solutions don&#8217;t necessarily fit every context that you&#8217;ll find a link in, and that&#8217;s where we see that intersection between the art of communication and the science of necessity.</p>\n\n\n\n<p><strong>Josepha Haden Chomphosy</strong> 3:32</p>\n\n\n\n<p>If you came with me earlier on the idea that accessibility is a subset of usability, and it&#8217;s not a far leap to say that the choices around accessibility implementations should always include design and the overall user experience.</p>\n\n\n\n<p>I know that some of you are thinking, &#8220;But we have guidelines! Like, that&#8217;s why we have the guidelines, so that not everything has to be a gray area.&#8221; And on the one hand, yeah, that&#8217;s true. There are a lot of guidelines. There are guidelines for the code, and what the code produces, and the design elements. But I worry that when a solution is driven solely by rules, rather than reasons, we run the risk of throwing out the good along with the bad.</p>\n\n\n\n<p><strong>Josepha Haden Chomphosy</strong> 4:15</p>\n\n\n\n<p>Accessibility has been a consistent topic of debate in the project for as long as I can remember, and based on all of this, it&#8217;s really clear why. There are a few big picture questions that still deserve some sort of canonical answer for WordPress, and where possible I dig in and research the positions that everyone has taken in the past. But I also have questions about how to move everything forward, especially as the editing experience gets more and more standardized across the software, which reduces cognitive load, shortens the learning curve, etc.</p>\n\n\n\n<p>What is the future possibility for having a series of more niche admin interface options?</p>\n\n\n\n<p>What would it be like to be able to account for functional limitations in a way that lets site builders select what is needed for their clients or organization, or just individual situations they know their sites would be maintained under?</p>\n\n\n\n<p>What more could we do if part of the setup flow of WordPress was to select some bundle of potential add ons for neuro diversity, or colorblindness, or dyslexia, and more?</p>\n\n\n\n<p>It&#8217;s a really big question I have.</p>\n\n\n\n<p><strong>Josepha Haden Chomphosy</strong> 5:26</p>\n\n\n\n<p>And I have to be really transparent here and share that my foundational understanding of accessibility and usability is 10 plus years old, and I learned it in the context of people in education, not software. So a lot of my questions about the future of accessibility and WordPress is the result of old knowledge exploring new spaces, which means they are a little untested. And I&#8217;m so grateful for the contributors who point out what the current research and thinking is, in this incredibly complex field.</p>\n\n\n\n<p><strong>Josepha Haden Chomphosy</strong> 6:00</p>\n\n\n\n<p>I normally like to wrap up the briefing with a tidy takeaway, but this particular topic doesn&#8217;t really lend itself to that. So I&#8217;ll leave you with this. I really believe in WordPress&#8217; mission to democratize publishing. And I, for one, will never stop learning about what gives people more access to the software, and what makes the software more usable, and especially how we can combine usability with accessibility in a way that puts form and function on a level playing field.</p>\n\n\n\n<p>[musical interlude]</p>\n\n\n\n<p><strong>Josepha Haden Chomphosy</strong> 6:40</p>\n\n\n\n<p>And now, that brings us to our small list of big things.</p>\n\n\n\n<p>Thing one, it&#8217;s that time of year where many of our community members take a short break to relax and refresh. I&#8217;ll be taking a bit of a break during the month of August, and so the WP Briefing will return again starting in September.</p>\n\n\n\n<p>And thing two, huge thanks to the production crew that helps me make this podcast every couple of weeks, but a special shout out to our editor Dustin Hartzler, who makes quick work of all of my rambling thoughts.</p>\n\n\n\n<p><strong>Josepha Haden Chomphosy</strong> 7:09</p>\n\n\n\n<p>And that is your small list of big things. Thank you for tuning in today for the WordPress Briefing. I&#8217;m your host, Josepha Haden Chomphosy, and I&#8217;ll see you again in September.</p>\n\n\n\n<p>[contemporary outro music]</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:30:\"com-wordpress:feed-additions:1\";a:1:{s:7:\"post-id\";a:1:{i:0;a:5:{s:4:\"data\";s:5:\"11096\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:2;a:6:{s:4:\"data\";s:66:\"\n		\n		\n		\n		\n		\n				\n		\n		\n		\n		\n\n					\n										\n					\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:4:{s:0:\"\";a:6:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:40:\"Configuring Theme Design with theme.json\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:76:\"https://wordpress.org/news/2021/07/configuring-theme-design-with-theme-json/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 29 Jul 2021 22:26:13 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:4:{i:0;a:5:{s:4:\"data\";s:6:\"Themes\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:6:\"design\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:2;a:5:{s:4:\"data\";s:11:\"development\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:3;a:5:{s:4:\"data\";s:9:\"Gutenberg\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:35:\"https://wordpress.org/news/?p=11060\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:368:\"Starting in WordPress 5.8, a new tool — “theme.json” — is available to use in your theme. Maybe you’re hearing about it for the first time, or maybe you’re testing and developing themes with it already. Either way, I&#8217;m glad you&#8217;re here because it&#8217;s an exciting time for WordPress themes. This post provides a quick introduction [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:8:\"Jeff Ong\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:21957:\"\n<figure class=\"wp-block-image size-large\"><img loading=\"lazy\" width=\"632\" height=\"356\" src=\"https://i2.wp.com/wordpress.org/news/files/2021/07/themejson-1.png?resize=632%2C356&#038;ssl=1\" alt=\"\" class=\"wp-image-11082\" srcset=\"https://i2.wp.com/wordpress.org/news/files/2021/07/themejson-1.png?resize=1024%2C576&amp;ssl=1 1024w, https://i2.wp.com/wordpress.org/news/files/2021/07/themejson-1.png?resize=300%2C169&amp;ssl=1 300w, https://i2.wp.com/wordpress.org/news/files/2021/07/themejson-1.png?resize=768%2C432&amp;ssl=1 768w, https://i2.wp.com/wordpress.org/news/files/2021/07/themejson-1.png?resize=1536%2C864&amp;ssl=1 1536w, https://i2.wp.com/wordpress.org/news/files/2021/07/themejson-1.png?resize=2048%2C1152&amp;ssl=1 2048w, https://i2.wp.com/wordpress.org/news/files/2021/07/themejson-1.png?w=1264&amp;ssl=1 1264w, https://i2.wp.com/wordpress.org/news/files/2021/07/themejson-1.png?w=1896&amp;ssl=1 1896w\" sizes=\"(max-width: 632px) 100vw, 632px\" data-recalc-dims=\"1\" /></figure>\n\n\n\n<p>Starting in <a href=\"https://wordpress.org/news/2021/07/tatum/\">WordPress 5.8</a>, a new tool — “theme.json” — is available to use in your theme. Maybe you’re hearing about it for the first time, or maybe you’re testing and developing themes with it already. Either way, I&#8217;m glad you&#8217;re here because it&#8217;s an exciting time for WordPress themes.</p>\n\n\n\n<p>This post provides a quick introduction to this new framework, and describes what’s possible by sharing a few practical tips and examples.</p>\n\n\n\n<h2>What’s theme.json?</h2>\n\n\n\n<p>Technically, theme.json is just a file that lives at the top-level of a theme’s directory.&nbsp;</p>\n\n\n\n<p>Conceptually, it’s a major shift in how themes can be developed. Theme authors now have a centralized mechanism to tailor the WordPress experience for site authors and visitors. Theme.json provides theme authors fine-grained control over global styles, block styles, and the block editor settings.</p>\n\n\n\n<p>By providing these settings and controls in a single file, theme.json provides a powerful framework that brings together many aspects of theme design and development. And as the block editor matures and adds more features, theme.json will shine as the backbone for themes and the editor to work <em>together</em> <img src=\"https://s.w.org/images/core/emoji/13.1.0/72x72/1f4aa.png\" alt=\"💪\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" />. </p>\n\n\n\n<h2>Why Use it?</h2>\n\n\n\n<p>It’s the future! But if you’re like me, you might need something more tangible to be convinced. Here are a few reasons why you might use theme.json today:</p>\n\n\n\n<ul><li>Control editor settings like color, typography, spacing, and layout, and consolidate where these settings are managed.</li><li>Guarantee that styles apply correctly to blocks and elements across your site.</li><li>Reduce the amount of boilerplate CSS a theme used to provide. Theme.json won&#8217;t replace your stylesheet completely — there will be instances where CSS is needed to give your theme that extra flare (transitions, animations, etc.). But it can greatly reduce the base CSS needed from the theme.</li></ul>\n\n\n\n<h2>How do I use it?</h2>\n\n\n\n<p>The rest of this post demonstrates a few theme.json configurations you can try out. The examples use the tt1-blocks<a href=\"https://github.com/WordPress/theme-experiments/blob/master/tt1-blocks/theme.json\"> theme.json</a> — <a href=\"https://wordpress.org/themes/tt1-blocks/\">the block-based version of this year’s default theme</a>. </p>\n\n\n\n<p>If you&#8217;re starting with an existing theme, you might try copying a theme.json from the <a href=\"https://github.com/WordPress/theme-experiments/\">WordPress/theme-experiments repository</a> (for example, <a href=\"https://github.com/WordPress/theme-experiments/blob/master/fse-tutorial/theme.json\">the fse-tutorial theme</a> by <a href=\"https://profiles.wordpress.org/poena/\">@poena</a>) and adding it to the root of your theme’s directory.</p>\n\n\n\n<h3><strong>Change the typography settings of your site globally</strong></h3>\n\n\n<div class=\"wp-block-syntaxhighlighter-code \"><pre class=\"brush: jscript; title: ; notranslate\">\n&quot;settings&quot;: {\n	&quot;typography&quot;: {\n		&quot;fontSize&quot;: &quot;30px&quot;,\n		...\n</pre></div>\n\n\n<p>Making the change above in theme.json would result in the following updates to your theme&#8217;s body typography styles (before and after): </p>\n\n\n\n<figure class=\"wp-block-gallery columns-2 is-cropped\"><ul class=\"blocks-gallery-grid\"><li class=\"blocks-gallery-item\"><figure><a href=\"https://i1.wp.com/wordpress.org/news/files/2021/07/Screen-Shot-2021-07-23-at-11.06.07-AM.png?ssl=1\"><img loading=\"lazy\" width=\"632\" height=\"398\" src=\"https://i1.wp.com/wordpress.org/news/files/2021/07/Screen-Shot-2021-07-23-at-11.06.07-AM.png?resize=632%2C398&#038;ssl=1\" alt=\"\" data-id=\"11062\" data-full-url=\"https://wordpress.org/news/files/2021/07/Screen-Shot-2021-07-23-at-11.06.07-AM.png\" data-link=\"https://wordpress.org/news/?attachment_id=11062\" class=\"wp-image-11062\" srcset=\"https://i1.wp.com/wordpress.org/news/files/2021/07/Screen-Shot-2021-07-23-at-11.06.07-AM.png?resize=1024%2C645&amp;ss