size=2048%2C1291&amp;ssl=1 2048w, https://i1.wp.com/wordpress.org/news/files/2021/07/Screen-Shot-2021-07-23-at-11.05.40-AM.png?w=1264&amp;ssl=1 1264w, https://i1.wp.com/wordpress.org/news/files/2021/07/Screen-Shot-2021-07-23-at-11.05.40-AM.png?w=1896&amp;ssl=1 1896w\" sizes=\"(max-width: 632px) 100vw, 632px\" data-recalc-dims=\"1\" /></a></figure></li></ul></figure>\n\n\n\n<h3><strong>Changing the base color settings of your site globally</strong></h3>\n\n\n<div class=\"wp-block-syntaxhighlighter-code \"><pre class=\"brush: jscript; title: ; notranslate\">\n&quot;styles&quot;: {\n	&quot;color&quot;: {\n		&quot;background&quot;: &quot;#ffc0cb&quot;,\n		&quot;text&quot;: &quot;#6A1515&quot;\n	},\n	...\n}\n</pre></div>\n\n\n<figure class=\"wp-block-gallery columns-2 is-cropped\"><ul class=\"blocks-gallery-grid\"><li class=\"blocks-gallery-item\"><figure><a href=\"https://i2.wp.com/wordpress.org/news/files/2021/07/Screen-Shot-2021-07-23-at-11.10.03-AM.png?ssl=1\"><img loading=\"lazy\" width=\"632\" height=\"398\" src=\"https://i2.wp.com/wordpress.org/news/files/2021/07/Screen-Shot-2021-07-23-at-11.10.03-AM.png?resize=632%2C398&#038;ssl=1\" alt=\"\" data-id=\"11063\" data-full-url=\"https://wordpress.org/news/files/2021/07/Screen-Shot-2021-07-23-at-11.10.03-AM.png\" data-link=\"https://wordpress.org/news/?attachment_id=11063\" class=\"wp-image-11063\" srcset=\"https://i2.wp.com/wordpress.org/news/files/2021/07/Screen-Shot-2021-07-23-at-11.10.03-AM.png?resize=1024%2C645&amp;ssl=1 1024w, https://i2.wp.com/wordpress.org/news/files/2021/07/Screen-Shot-2021-07-23-at-11.10.03-AM.png?resize=300%2C189&amp;ssl=1 300w, https://i2.wp.com/wordpress.org/news/files/2021/07/Screen-Shot-2021-07-23-at-11.10.03-AM.png?resize=768%2C484&amp;ssl=1 768w, https://i2.wp.com/wordpress.org/news/files/2021/07/Screen-Shot-2021-07-23-at-11.10.03-AM.png?resize=1536%2C968&amp;ssl=1 1536w, https://i2.wp.com/wordpress.org/news/files/2021/07/Screen-Shot-2021-07-23-at-11.10.03-AM.png?resize=2048%2C1291&amp;ssl=1 2048w, https://i2.wp.com/wordpress.org/news/files/2021/07/Screen-Shot-2021-07-23-at-11.10.03-AM.png?w=1264&amp;ssl=1 1264w, https://i2.wp.com/wordpress.org/news/files/2021/07/Screen-Shot-2021-07-23-at-11.10.03-AM.png?w=1896&amp;ssl=1 1896w\" sizes=\"(max-width: 632px) 100vw, 632px\" data-recalc-dims=\"1\" /></a></figure></li><li class=\"blocks-gallery-item\"><figure><a href=\"https://i2.wp.com/wordpress.org/news/files/2021/07/Screen-Shot-2021-07-23-at-11.08.54-AM.png?ssl=1\"><img loading=\"lazy\" width=\"632\" height=\"398\" src=\"https://i2.wp.com/wordpress.org/news/files/2021/07/Screen-Shot-2021-07-23-at-11.08.54-AM.png?resize=632%2C398&#038;ssl=1\" alt=\"\" data-id=\"11064\" data-full-url=\"https://wordpress.org/news/files/2021/07/Screen-Shot-2021-07-23-at-11.08.54-AM.png\" data-link=\"https://wordpress.org/news/?attachment_id=11064\" class=\"wp-image-11064\" srcset=\"https://i2.wp.com/wordpress.org/news/files/2021/07/Screen-Shot-2021-07-23-at-11.08.54-AM.png?resize=1024%2C645&amp;ssl=1 1024w, https://i2.wp.com/wordpress.org/news/files/2021/07/Screen-Shot-2021-07-23-at-11.08.54-AM.png?resize=300%2C189&amp;ssl=1 300w, https://i2.wp.com/wordpress.org/news/files/2021/07/Screen-Shot-2021-07-23-at-11.08.54-AM.png?resize=768%2C484&amp;ssl=1 768w, https://i2.wp.com/wordpress.org/news/files/2021/07/Screen-Shot-2021-07-23-at-11.08.54-AM.png?resize=1536%2C968&amp;ssl=1 1536w, https://i2.wp.com/wordpress.org/news/files/2021/07/Screen-Shot-2021-07-23-at-11.08.54-AM.png?resize=2048%2C1291&amp;ssl=1 2048w, https://i2.wp.com/wordpress.org/news/files/2021/07/Screen-Shot-2021-07-23-at-11.08.54-AM.png?w=1264&amp;ssl=1 1264w, https://i2.wp.com/wordpress.org/news/files/2021/07/Screen-Shot-2021-07-23-at-11.08.54-AM.png?w=1896&amp;ssl=1 1896w\" sizes=\"(max-width: 632px) 100vw, 632px\" data-recalc-dims=\"1\" /></a></figure></li></ul></figure>\n\n\n\n<h3><strong><strong>Changing spacing / padding settings on specific blocks</strong></strong></h3>\n\n\n<div class=\"wp-block-syntaxhighlighter-code \"><pre class=\"brush: jscript; title: ; notranslate\">\n&quot;styles&quot;: {\n	&quot;blocks&quot;: {\n		&quot;core/code&quot;: {\n			&quot;spacing&quot;: {\n				&quot;padding&quot;: {\n					&quot;top&quot;: &quot;3em&quot;,\n					&quot;bottom&quot;: &quot;3em&quot;,\n					&quot;left&quot;: &quot;3em&quot;,\n					&quot;right&quot;: &quot;3em&quot;\n				}\n			}\n		}\n	}\n}\n\n</pre></div>\n\n\n<figure class=\"wp-block-gallery columns-2 is-cropped\"><ul class=\"blocks-gallery-grid\"><li class=\"blocks-gallery-item\"><figure><a href=\"https://i2.wp.com/wordpress.org/news/files/2021/07/code-padding-original.png?ssl=1\"><img loading=\"lazy\" width=\"632\" height=\"356\" src=\"https://i2.wp.com/wordpress.org/news/files/2021/07/code-padding-original.png?resize=632%2C356&#038;ssl=1\" alt=\"\" data-id=\"11065\" data-full-url=\"https://wordpress.org/news/files/2021/07/code-padding-original.png\" data-link=\"https://wordpress.org/news/?attachment_id=11065\" class=\"wp-image-11065\" srcset=\"https://i2.wp.com/wordpress.org/news/files/2021/07/code-padding-original.png?resize=1024%2C576&amp;ssl=1 1024w, https://i2.wp.com/wordpress.org/news/files/2021/07/code-padding-original.png?resize=300%2C169&amp;ssl=1 300w, https://i2.wp.com/wordpress.org/news/files/2021/07/code-padding-original.png?resize=768%2C432&amp;ssl=1 768w, https://i2.wp.com/wordpress.org/news/files/2021/07/code-padding-original.png?resize=1536%2C864&amp;ssl=1 1536w, https://i2.wp.com/wordpress.org/news/files/2021/07/code-padding-original.png?w=1600&amp;ssl=1 1600w, https://i2.wp.com/wordpress.org/news/files/2021/07/code-padding-original.png?w=1264&amp;ssl=1 1264w\" sizes=\"(max-width: 632px) 100vw, 632px\" data-recalc-dims=\"1\" /></a></figure></li><li class=\"blocks-gallery-item\"><figure><a href=\"https://i1.wp.com/wordpress.org/news/files/2021/07/code-padding-edited.png?ssl=1\"><img loading=\"lazy\" width=\"632\" height=\"356\" src=\"https://i0.wp.com/wordpress.org/news/files/2021/07/code-padding-edited-1024x576.png?resize=632%2C356&#038;ssl=1\" alt=\"\" data-id=\"11066\" data-full-url=\"https://wordpress.org/news/files/2021/07/code-padding-edited.png\" data-link=\"https://wordpress.org/news/?attachment_id=11066\" class=\"wp-image-11066\" srcset=\"https://i1.wp.com/wordpress.org/news/files/2021/07/code-padding-edited.png?resize=1024%2C576&amp;ssl=1 1024w, https://i1.wp.com/wordpress.org/news/files/2021/07/code-padding-edited.png?resize=300%2C169&amp;ssl=1 300w, https://i1.wp.com/wordpress.org/news/files/2021/07/code-padding-edited.png?resize=768%2C432&amp;ssl=1 768w, https://i1.wp.com/wordpress.org/news/files/2021/07/code-padding-edited.png?resize=1536%2C864&amp;ssl=1 1536w, https://i1.wp.com/wordpress.org/news/files/2021/07/code-padding-edited.png?w=1600&amp;ssl=1 1600w, https://i1.wp.com/wordpress.org/news/files/2021/07/code-padding-edited.png?w=1264&amp;ssl=1 1264w\" sizes=\"(max-width: 632px) 100vw, 632px\" data-recalc-dims=\"1\" /></a></figure></li></ul></figure>\n\n\n\n<h3><strong><strong>Set a custom color palette in the editor for specific blocks like a button </strong></strong></h3>\n\n\n<div class=\"wp-block-syntaxhighlighter-code \"><pre class=\"brush: jscript; title: ; notranslate\">\n&quot;settings&quot;: {\n    &quot;blocks&quot;: {\n		&quot;core/button&quot;: {\n			&quot;color&quot;: {\n				&quot;palette&quot;: &#91; \n					{\n						&quot;name&quot;: &quot;Maroon&quot;,\n						&quot;color&quot;: &quot;#6A1515&quot;,\n						&quot;slug&quot;: &quot;maroon&quot;\n					},\n					{\n						&quot;name&quot;: &quot;Strawberry Ice Cream&quot;,\n						&quot;color&quot;: &quot;#FFC0CB&quot;,\n						&quot;slug&quot;: &quot;strawberry-ice-cream&quot;\n					}\n				]\n			}\n		}\n	}\n}\n</pre></div>\n\n\n<figure class=\"wp-block-gallery columns-2 is-cropped\"><ul class=\"blocks-gallery-grid\"><li class=\"blocks-gallery-item\"><figure><a href=\"https://i0.wp.com/wordpress.org/news/files/2021/07/button-all-colors.png?ssl=1\"><img loading=\"lazy\" width=\"632\" height=\"444\" src=\"https://i0.wp.com/wordpress.org/news/files/2021/07/button-all-colors.png?resize=632%2C444&#038;ssl=1\" alt=\"\" data-id=\"11069\" data-full-url=\"https://wordpress.org/news/files/2021/07/button-all-colors.png\" data-link=\"https://wordpress.org/news/?attachment_id=11069\" class=\"wp-image-11069\" srcset=\"https://i0.wp.com/wordpress.org/news/files/2021/07/button-all-colors.png?resize=1024%2C719&amp;ssl=1 1024w, https://i0.wp.com/wordpress.org/news/files/2021/07/button-all-colors.png?resize=300%2C211&amp;ssl=1 300w, https://i0.wp.com/wordpress.org/news/files/2021/07/button-all-colors.png?resize=768%2C539&amp;ssl=1 768w, https://i0.wp.com/wordpress.org/news/files/2021/07/button-all-colors.png?resize=1536%2C1079&amp;ssl=1 1536w, https://i0.wp.com/wordpress.org/news/files/2021/07/button-all-colors.png?resize=2048%2C1438&amp;ssl=1 2048w, https://i0.wp.com/wordpress.org/news/files/2021/07/button-all-colors.png?w=1264&amp;ssl=1 1264w, https://i0.wp.com/wordpress.org/news/files/2021/07/button-all-colors.png?w=1896&amp;ssl=1 1896w\" sizes=\"(max-width: 632px) 100vw, 632px\" data-recalc-dims=\"1\" /></a></figure></li><li class=\"blocks-gallery-item\"><figure><a href=\"https://i1.wp.com/wordpress.org/news/files/2021/07/buttons-custom-palette.png?ssl=1\"><img loading=\"lazy\" width=\"632\" height=\"444\" src=\"https://i1.wp.com/wordpress.org/news/files/2021/07/buttons-custom-palette.png?resize=632%2C444&#038;ssl=1\" alt=\"\" data-id=\"11070\" data-full-url=\"https://wordpress.org/news/files/2021/07/buttons-custom-palette.png\" data-link=\"https://wordpress.org/news/?attachment_id=11070\" class=\"wp-image-11070\" srcset=\"https://i1.wp.com/wordpress.org/news/files/2021/07/buttons-custom-palette.png?resize=1024%2C719&amp;ssl=1 1024w, https://i1.wp.com/wordpress.org/news/files/2021/07/buttons-custom-palette.png?resize=300%2C211&amp;ssl=1 300w, https://i1.wp.com/wordpress.org/news/files/2021/07/buttons-custom-palette.png?resize=768%2C539&amp;ssl=1 768w, https://i1.wp.com/wordpress.org/news/files/2021/07/buttons-custom-palette.png?resize=1536%2C1079&amp;ssl=1 1536w, https://i1.wp.com/wordpress.org/news/files/2021/07/buttons-custom-palette.png?resize=2048%2C1438&amp;ssl=1 2048w, https://i1.wp.com/wordpress.org/news/files/2021/07/buttons-custom-palette.png?w=1264&amp;ssl=1 1264w, https://i1.wp.com/wordpress.org/news/files/2021/07/buttons-custom-palette.png?w=1896&amp;ssl=1 1896w\" sizes=\"(max-width: 632px) 100vw, 632px\" data-recalc-dims=\"1\" /></a></figure></li></ul></figure>\n\n\n\n<h3><strong><strong>Enable and disable typography controls</strong></strong></h3>\n\n\n\n<p>In the following example, the ability to supply a custom font size and line height for all heading blocks is disabled:</p>\n\n\n<div class=\"wp-block-syntaxhighlighter-code \"><pre class=\"brush: jscript; title: ; notranslate\">\n	&quot;settings&quot;: {\n		&quot;blocks&quot;: {\n			&quot;core/heading&quot;: {\n				&quot;typography&quot;: {\n					&quot;customFontSize&quot;: false,\n					&quot;customLineHeight&quot;: false\n				}\n			}\n		}\n	}\n</pre></div>\n\n\n<figure class=\"wp-block-gallery columns-2 is-cropped\"><ul class=\"blocks-gallery-grid\"><li class=\"blocks-gallery-item\"><figure><a href=\"https://i1.wp.com/wordpress.org/news/files/2021/07/heading-all-options.png?ssl=1\"><img loading=\"lazy\" width=\"632\" height=\"444\" src=\"https://i1.wp.com/wordpress.org/news/files/2021/07/heading-all-options.png?resize=632%2C444&#038;ssl=1\" alt=\"\" data-id=\"11071\" data-full-url=\"https://wordpress.org/news/files/2021/07/heading-all-options.png\" data-link=\"https://wordpress.org/news/?attachment_id=11071\" class=\"wp-image-11071\" srcset=\"https://i1.wp.com/wordpress.org/news/files/2021/07/heading-all-options.png?resize=1024%2C719&amp;ssl=1 1024w, https://i1.wp.com/wordpress.org/news/files/2021/07/heading-all-options.png?resize=300%2C211&amp;ssl=1 300w, https://i1.wp.com/wordpress.org/news/files/2021/07/heading-all-options.png?resize=768%2C539&amp;ssl=1 768w, https://i1.wp.com/wordpress.org/news/files/2021/07/heading-all-options.png?resize=1536%2C1079&amp;ssl=1 1536w, https://i1.wp.com/wordpress.org/news/files/2021/07/heading-all-options.png?resize=2048%2C1438&amp;ssl=1 2048w, https://i1.wp.com/wordpress.org/news/files/2021/07/heading-all-options.png?w=1264&amp;ssl=1 1264w, https://i1.wp.com/wordpress.org/news/files/2021/07/heading-all-options.png?w=1896&amp;ssl=1 1896w\" sizes=\"(max-width: 632px) 100vw, 632px\" data-recalc-dims=\"1\" /></a></figure></li><li class=\"blocks-gallery-item\"><figure><a href=\"https://i2.wp.com/wordpress.org/news/files/2021/07/heading-no-line-height-custom-size.png?ssl=1\"><img loading=\"lazy\" width=\"632\" height=\"444\" src=\"https://i2.wp.com/wordpress.org/news/files/2021/07/heading-no-line-height-custom-size.png?resize=632%2C444&#038;ssl=1\" alt=\"\" data-id=\"11072\" data-full-url=\"https://wordpress.org/news/files/2021/07/heading-no-line-height-custom-size.png\" data-link=\"https://wordpress.org/news/?attachment_id=11072\" class=\"wp-image-11072\" srcset=\"https://i2.wp.com/wordpress.org/news/files/2021/07/heading-no-line-height-custom-size.png?resize=1024%2C719&amp;ssl=1 1024w, https://i2.wp.com/wordpress.org/news/files/2021/07/heading-no-line-height-custom-size.png?resize=300%2C211&amp;ssl=1 300w, https://i2.wp.com/wordpress.org/news/files/2021/07/heading-no-line-height-custom-size.png?resize=768%2C539&amp;ssl=1 768w, https://i2.wp.com/wordpress.org/news/files/2021/07/heading-no-line-height-custom-size.png?resize=1536%2C1079&amp;ssl=1 1536w, https://i2.wp.com/wordpress.org/news/files/2021/07/heading-no-line-height-custom-size.png?resize=2048%2C1438&amp;ssl=1 2048w, https://i2.wp.com/wordpress.org/news/files/2021/07/heading-no-line-height-custom-size.png?w=1264&amp;ssl=1 1264w, https://i2.wp.com/wordpress.org/news/files/2021/07/heading-no-line-height-custom-size.png?w=1896&amp;ssl=1 1896w\" sizes=\"(max-width: 632px) 100vw, 632px\" data-recalc-dims=\"1\" /></a></figure></li></ul></figure>\n\n\n\n<h2>What&#8217;s Next?</h2>\n\n\n\n<p>I hope this gives you a sense of what&#8217;s possible and where themes are going. The above examples just scratch the surface of what kinds of theme design configurations are possible, and I’m very excited to see what theme authors create.</p>\n\n\n\n<p>If you&#8217;re interested in learning more, <a href=\"https://make.wordpress.org/core/2021/06/25/introducing-theme-json-in-wordpress-5-8/\">here&#8217;s the developer note on theme.json</a>, and <a href=\"https://developer.wordpress.org/block-editor/how-to-guides/themes/theme-json/\">here&#8217;s the documentation for theme.json</a> in the handbook.</p>\n\n\n\n<hr class=\"wp-block-separator is-style-wide\" />\n\n\n\n<p><em><strong>Thanks to <a href=\"https://profiles.wordpress.org/kjellr/\">@kjellr</a>, <a href=\"https://profiles.wordpress.org/chanthaboune/\">@</a></strong></em><strong><em><a href=\"https://profiles.wordpress.org/chanthaboune/\">chanthaboune</a>, <a href=\"https://profiles.wordpress.org/priethor/\">@priethor</a>, <a href=\"https://profiles.wordpress.org/annezazu/\">@annezazu</a> for helping with and peer-reviewing this post.</em></strong></p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:30:\"com-wordpress:feed-additions:1\";a:1:{s:7:\"post-id\";a:1:{i:0;a:5:{s:4:\"data\";s:5:\"11060\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:3;a:6:{s:4:\"data\";s:60:\"\n		\n		\n		\n		\n		\n				\n		\n		\n\n					\n										\n					\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:4:{s:0:\"\";a:6:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:19:\"WordPress 5.8 Tatum\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:41:\"https://wordpress.org/news/2021/07/tatum/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 20 Jul 2021 17:43:25 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:8:\"Releases\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:3:\"5.8\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:35:\"https://wordpress.org/news/?p=10976\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:277:\"Introducing 5.8 “Tatum”, our latest and greatest release, named in honor of the legendary jazz pianist Art Tatum. This release includes an all new widget editor powered by blocks, major technical tools for building block themes, as well as newly streamlined workflow tools.\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Matt Mullenweg\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:54016:\"\n<div style=\"height:20px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n\n\n\n<figure class=\"wp-block-image size-large\"><img loading=\"lazy\" width=\"632\" height=\"422\" src=\"https://i0.wp.com/wordpress.org/news/files/2021/07/5x8-Album-1.jpg?resize=632%2C422&#038;ssl=1\" alt=\"\" class=\"wp-image-11042\" data-recalc-dims=\"1\" /></figure>\n\n\n\n<p>Introducing 5.8 “Tatum”, our latest and greatest release now available for&nbsp;<a href=\"https://wordpress.org/download/\">download</a>&nbsp;or update in your dashboard. Named in honor of Art Tatum, the legendary Jazz pianist. His formidable technique and willingness to push boundaries inspired musicians and changed what people thought could be done.&nbsp;</p>\n\n\n\n<p>So fire up your music service of choice and enjoy Tatum’s famous recordings of ‘Tea for Two’, ‘Tiger Rag’, ‘Begin the Beguine’, and ‘Night and Day’ as you read about what the latest WordPress version brings to you.</p>\n\n\n\n<hr class=\"wp-block-separator is-style-wide\" />\n\n\n\n<h2 class=\"has-text-align-center\">Three Essential Powerhouses</h2>\n\n\n\n<div style=\"height:16px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n\n\n\n<figure class=\"wp-block-gallery columns-2 is-cropped\"><ul class=\"blocks-gallery-grid\"><li class=\"blocks-gallery-item\"><figure><img loading=\"lazy\" width=\"632\" height=\"474\" src=\"https://i1.wp.com/wordpress.org/news/files/2021/07/about-widgets-blocks.png?resize=632%2C474&#038;ssl=1\" alt=\"\" data-id=\"10985\" data-full-url=\"https://wordpress.org/news/files/2021/07/about-widgets-blocks.png\" data-link=\"https://wordpress.org/news/?attachment_id=10985\" class=\"wp-image-10985\" srcset=\"https://i1.wp.com/wordpress.org/news/files/2021/07/about-widgets-blocks.png?resize=1024%2C768&amp;ssl=1 1024w, https://i1.wp.com/wordpress.org/news/files/2021/07/about-widgets-blocks.png?resize=300%2C225&amp;ssl=1 300w, https://i1.wp.com/wordpress.org/news/files/2021/07/about-widgets-blocks.png?resize=768%2C576&amp;ssl=1 768w, https://i1.wp.com/wordpress.org/news/files/2021/07/about-widgets-blocks.png?w=1280&amp;ssl=1 1280w\" sizes=\"(max-width: 632px) 100vw, 632px\" data-recalc-dims=\"1\" /></figure></li><li class=\"blocks-gallery-item\"><figure><img loading=\"lazy\" width=\"632\" height=\"501\" src=\"https://i2.wp.com/wordpress.org/news/files/2021/07/about-query-loop.png?resize=632%2C501&#038;ssl=1\" alt=\"\" data-id=\"10986\" data-full-url=\"https://wordpress.org/news/files/2021/07/about-query-loop.png\" data-link=\"https://wordpress.org/news/?attachment_id=10986\" class=\"wp-image-10986\" srcset=\"https://i2.wp.com/wordpress.org/news/files/2021/07/about-query-loop.png?resize=1024%2C811&amp;ssl=1 1024w, https://i2.wp.com/wordpress.org/news/files/2021/07/about-query-loop.png?resize=300%2C238&amp;ssl=1 300w, https://i2.wp.com/wordpress.org/news/files/2021/07/about-query-loop.png?resize=768%2C608&amp;ssl=1 768w, https://i2.wp.com/wordpress.org/news/files/2021/07/about-query-loop.png?w=1280&amp;ssl=1 1280w\" sizes=\"(max-width: 632px) 100vw, 632px\" data-recalc-dims=\"1\" /></figure></li><li class=\"blocks-gallery-item\"><figure><img loading=\"lazy\" width=\"632\" height=\"411\" src=\"https://i2.wp.com/wordpress.org/news/files/2021/07/about-template.png?resize=632%2C411&#038;ssl=1\" alt=\"\" data-id=\"10987\" data-full-url=\"https://wordpress.org/news/files/2021/07/about-template.png\" data-link=\"https://wordpress.org/news/?attachment_id=10987\" class=\"wp-image-10987\" srcset=\"https://i2.wp.com/wordpress.org/news/files/2021/07/about-template.png?resize=1024%2C666&amp;ssl=1 1024w, https://i2.wp.com/wordpress.org/news/files/2021/07/about-template.png?resize=300%2C195&amp;ssl=1 300w, https://i2.wp.com/wordpress.org/news/files/2021/07/about-template.png?resize=768%2C499&amp;ssl=1 768w, https://i2.wp.com/wordpress.org/news/files/2021/07/about-template.png?w=1280&amp;ssl=1 1280w\" sizes=\"(max-width: 632px) 100vw, 632px\" data-recalc-dims=\"1\" /></figure></li></ul></figure>\n\n\n\n<h3>Manage Widgets with Blocks</h3>\n\n\n\n<p>After months of hard work, the power of blocks has come to both the Block Widgets Editor and the Customizer. Now you can add blocks both in widget areas across your site and with live preview through the Customizer. This opens up new possibilities to create content: from no-code mini layouts to the vast library of core and third-party blocks. For our developers, you can find more details in the&nbsp;<a href=\"https://make.wordpress.org/core/2021/06/29/block-based-widgets-editor-in-wordpress-5-8/\">Widgets dev note</a>.</p>\n\n\n\n<h3>Display Posts with New Blocks and Patterns</h3>\n\n\n\n<p>The Query Loop Block makes it possible to display posts based on specified parameters; like a PHP loop without the code. Easily display posts from a specific category, to do things like create a portfolio or a page full of your favorite recipes. Think of it as a more complex and powerful Latest Posts Block! Plus, pattern suggestions make it easier than ever to create a list of posts with the design you want.</p>\n\n\n\n<h3>Edit the Templates Around Posts</h3>\n\n\n\n<p>You can use the familiar block editor to edit templates that hold your content—simply activate a block theme or a theme that has opted in for this feature. Switch from editing your posts to editing your pages and back again, all while using a familiar block editor. There are more than 20 new blocks available within compatible themes. Read more about this feature and how to experiment with it in the release notes.</p>\n\n\n\n<div style=\"height:32px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n\n\n\n<h2 class=\"has-text-align-center\">Three Workflow Helpers</h2>\n\n\n\n<div style=\"height:16px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n\n\n\n<figure class=\"wp-block-gallery columns-2 is-cropped\"><ul class=\"blocks-gallery-grid\"><li class=\"blocks-gallery-item\"><figure><img loading=\"lazy\" width=\"632\" height=\"496\" src=\"https://i1.wp.com/wordpress.org/news/files/2021/07/about-list-view.png?resize=632%2C496&#038;ssl=1\" alt=\"\" data-id=\"10988\" data-full-url=\"https://wordpress.org/news/files/2021/07/about-list-view.png\" data-link=\"https://wordpress.org/news/?attachment_id=10988\" class=\"wp-image-10988\" srcset=\"https://i1.wp.com/wordpress.org/news/files/2021/07/about-list-view.png?resize=1024%2C803&amp;ssl=1 1024w, https://i1.wp.com/wordpress.org/news/files/2021/07/about-list-view.png?resize=300%2C235&amp;ssl=1 300w, https://i1.wp.com/wordpress.org/news/files/2021/07/about-list-view.png?resize=768%2C602&amp;ssl=1 768w, https://i1.wp.com/wordpress.org/news/files/2021/07/about-list-view.png?w=1280&amp;ssl=1 1280w\" sizes=\"(max-width: 632px) 100vw, 632px\" data-recalc-dims=\"1\" /></figure></li><li class=\"blocks-gallery-item\"><figure><img loading=\"lazy\" width=\"632\" height=\"343\" src=\"https://i2.wp.com/wordpress.org/news/files/2021/07/about-pattern-suggestions.png?resize=632%2C343&#038;ssl=1\" alt=\"\" data-id=\"10989\" data-full-url=\"https://wordpress.org/news/files/2021/07/about-pattern-suggestions.png\" data-link=\"https://wordpress.org/news/?attachment_id=10989\" class=\"wp-image-10989\" srcset=\"https://i2.wp.com/wordpress.org/news/files/2021/07/about-pattern-suggestions.png?resize=1024%2C555&amp;ssl=1 1024w, https://i2.wp.com/wordpress.org/news/files/2021/07/about-pattern-suggestions.png?resize=300%2C163&amp;ssl=1 300w, https://i2.wp.com/wordpress.org/news/files/2021/07/about-pattern-suggestions.png?resize=768%2C416&amp;ssl=1 768w, https://i2.wp.com/wordpress.org/news/files/2021/07/about-pattern-suggestions.png?w=1280&amp;ssl=1 1280w\" sizes=\"(max-width: 632px) 100vw, 632px\" data-recalc-dims=\"1\" /></figure></li><li class=\"blocks-gallery-item\"><figure><img loading=\"lazy\" width=\"632\" height=\"517\" src=\"https://i0.wp.com/wordpress.org/news/files/2021/07/about-duotone.png?resize=632%2C517&#038;ssl=1\" alt=\"\" data-id=\"10990\" data-full-url=\"https://wordpress.org/news/files/2021/07/about-duotone.png\" data-link=\"https://wordpress.org/news/?attachment_id=10990\" class=\"wp-image-10990\" srcset=\"https://i0.wp.com/wordpress.org/news/files/2021/07/about-duotone.png?resize=1024%2C837&amp;ssl=1 1024w, https://i0.wp.com/wordpress.org/news/files/2021/07/about-duotone.png?resize=300%2C245&amp;ssl=1 300w, https://i0.wp.com/wordpress.org/news/files/2021/07/about-duotone.png?resize=768%2C628&amp;ssl=1 768w, https://i0.wp.com/wordpress.org/news/files/2021/07/about-duotone.png?w=1280&amp;ssl=1 1280w\" sizes=\"(max-width: 632px) 100vw, 632px\" data-recalc-dims=\"1\" /></figure></li></ul></figure>\n\n\n\n<h3>Overview of the Page Structure</h3>\n\n\n\n<p>Sometimes you need a simple landing page, but sometimes you need something a little more robust. As blocks increase, patterns emerge, and content creation gets easier, new solutions are needed to make complex content easy to navigate. List View is the best way to jump between layers of content and nested blocks. Since the List View gives you an overview of all the blocks in your content, you can now navigate quickly to the precise block you need. Ready to focus completely on your content? Toggle it on or off to suit your workflow.</p>\n\n\n\n<h3>Suggested Patterns for Blocks</h3>\n\n\n\n<p>Starting in this release the Pattern Transformations tool will suggest block patterns based on the block you are using. Right now, you can give it a try in the Query Block and Social Icon Block. As more patterns are added, you will be able to get inspiration for how to style your site without ever leaving the editor!</p>\n\n\n\n<h3>Style and Colorize Images</h3>\n\n\n\n<p>Colorize your image and cover blocks with duotone filters! Duotone can add a pop of color to your designs and style your images (or videos in the cover block) to integrate well with your themes. You can think of the duotone effect as a black and white filter, but instead of the shadows being black and the highlights being white, you pick your own colors for the shadows and highlights. There’s more to learn about how it works in the documentation.</p>\n\n\n\n<div style=\"height:32px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n\n\n\n<h2 class=\"has-text-align-center\">For Developers to Explore</h2>\n\n\n\n<div style=\"height:16px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n\n\n\n<figure class=\"wp-block-image size-large\"><img loading=\"lazy\" width=\"632\" height=\"378\" src=\"https://i1.wp.com/wordpress.org/news/files/2021/07/about-theme-json-2x.png?resize=632%2C378&#038;ssl=1\" alt=\"\" class=\"wp-image-10992\" srcset=\"https://i1.wp.com/wordpress.org/news/files/2021/07/about-theme-json-2x.png?resize=1024%2C613&amp;ssl=1 1024w, https://i1.wp.com/wordpress.org/news/files/2021/07/about-theme-json-2x.png?resize=300%2C179&amp;ssl=1 300w, https://i1.wp.com/wordpress.org/news/files/2021/07/about-theme-json-2x.png?resize=768%2C459&amp;ssl=1 768w, https://i1.wp.com/wordpress.org/news/files/2021/07/about-theme-json-2x.png?resize=1536%2C919&amp;ssl=1 1536w, https://i1.wp.com/wordpress.org/news/files/2021/07/about-theme-json-2x.png?resize=2048%2C1225&amp;ssl=1 2048w, https://i1.wp.com/wordpress.org/news/files/2021/07/about-theme-json-2x.png?w=1264&amp;ssl=1 1264w, https://i1.wp.com/wordpress.org/news/files/2021/07/about-theme-json-2x.png?w=1896&amp;ssl=1 1896w\" sizes=\"(max-width: 632px) 100vw, 632px\" data-recalc-dims=\"1\" /></figure>\n\n\n\n<div style=\"height:16px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n\n\n\n<h3>Theme.json</h3>\n\n\n\n<p>Introducing the Global Styles and Global Settings APIs: control the editor settings, available customization tools, and style blocks using a theme.json file in the active theme. This configuration file enables or disables features and sets default styles for both a website and blocks. If you build themes, you can experiment with this early iteration of a useful new feature. For more about what is currently available and how it works,&nbsp;<a href=\"https://make.wordpress.org/core/2021/06/25/introducing-theme-json-in-wordpress-5-8/\">check out this dev note</a>.</p>\n\n\n\n<div style=\"height:16px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n\n\n\n<div class=\"wp-block-columns\">\n<div class=\"wp-block-column\">\n<h3>Dropping support for IE11</h3>\n\n\n\n<p>Support for Internet Explorer 11 has been dropped as of this release. This means you may have issues managing your site that will not be fixed in the future. If you are currently using IE11, it is strongly recommended that you&nbsp;<a href=\"https://browsehappy.com/\">switch to a more modern browser</a>.</p>\n</div>\n\n\n\n<div class=\"wp-block-column\">\n<h3>Adding support for WebP</h3>\n\n\n\n<p>WebP is a modern image format that provides improved lossless and lossy compression for images on the web. WebP images are around 30% smaller on average than their JPEG or PNG equivalents, resulting in sites that are faster and use less bandwidth.</p>\n</div>\n</div>\n\n\n\n<h3>Adding Additional Block Supports</h3>\n\n\n\n<p>Expanding on previously implemented block supports in WordPress&nbsp;<a href=\"https://make.wordpress.org/core/2020/11/18/block-supports-in-wordpress-5-6/\">5.6</a>&nbsp;and&nbsp;<a href=\"https://make.wordpress.org/core/2021/02/24/changes-to-block-editor-components-and-blocks/\">5.7</a>, WordPress 5.8 introduces several new block support flags and new options to customize your registered blocks. More information is available in the&nbsp;<a href=\"https://make.wordpress.org/core/2021/06/25/block-supports-api-updates-for-wordpress-5-8/\">block supports dev note</a>.</p>\n\n\n\n<div style=\"height:16px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n\n\n\n<h3>Check the Field Guide for more!</h3>\n\n\n\n<p>Check out the latest version of the WordPress Field Guide. It highlights developer notes for each change you may want to be aware of:&nbsp;<a href=\"https://make.wordpress.org/core/2021/07/03/wordpress-5-8-field-guide/\">WordPress 5.8 Field Guide.</a></p>\n\n\n\n<hr class=\"wp-block-separator is-style-wide\" />\n\n\n\n<h2>The Squad</h2>\n\n\n\n<p>The WordPress 5.8 release was led by <a href=\"https://profiles.wordpress.org/matt/\">Matt Mullenweg</a>, and supported by this highly enthusiastic release squad:</p>\n\n\n\n<ul><li><strong>Release Co-Coordinator:</strong>&nbsp;Jeffrey Paul (<a href=\'https://profiles.wordpress.org/jeffpaul/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>jeffpaul</a>)</li><li><strong>Release Co-Coordinator:</strong>&nbsp;Jonathan Desrosiers (<a href=\'https://profiles.wordpress.org/desrosj/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>desrosj</a>)</li><li><strong>Editor Tech Lead:</strong>&nbsp;Riad Benguella (<a href=\'https://profiles.wordpress.org/youknowriad/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>youknowriad</a>)</li><li><strong>Marketing and Communications Lead:</strong> Josepha Haden Chomphosy (<a href=\'https://profiles.wordpress.org/chanthaboune/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>chanthaboune</a>)</li><li><strong>Documentation Lead:</strong> Milana Cap (<a href=\'https://profiles.wordpress.org/milana_cap/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>milana_cap</a>)</li><li><strong>Test Lead:</strong>&nbsp;Piotrek Boniu (<a href=\'https://profiles.wordpress.org/boniu91/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>boniu91</a>)</li><li><strong>Support Lead:&nbsp;</strong>Mary Job (<a href=\'https://profiles.wordpress.org/mariaojob/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>mariaojob</a>)</li></ul>\n\n\n\n<p>This release is the reflection of the hard work of 530 generous volunteer contributors. Collaboration occurred on over <a href=\"https://core.trac.wordpress.org/query?milestone=5.8&amp;group=component&amp;col=id&amp;col=summary&amp;col=milestone&amp;col=owner&amp;col=type&amp;col=status&amp;col=priority&amp;order=priority\">320 tickets on Trac</a> and over <a href=\"https://github.com/wordpress/gutenberg/compare/v10.0.0...v10.7.0\">1,500 pull requests on GitHub</a>.</p>\n\n\n\n<a href=\"https://profiles.wordpress.org/5ubliminal/\">5ubliminal</a>, <a href=\"https://profiles.wordpress.org/ninetyninew/\">99w</a>, <a href=\"https://profiles.wordpress.org/