(49, 2, '2021-07-20 20:06:00', '2021-07-20 20:06:00', '<!-- wp:paragraph -->\n<p>El rol de Colaborador (<a rel=\"noreferrer noopener\" href=\"https://codex.wordpress.org/Roles_and_Capabilities#Contributor\" target=\"_blank\">Contributor</a> en inglés) te permite escribir y editar tus propias entradas pero no publicarlas y tampoco te permite subir nada a la biblioteca de medios. Es decir, este rol es el que deberías asignar a un escritor esporádico o invitado que quieras que escriba una entrada en tu blog. Ten en cuenta que tendrá que ser el Editor el que se encargue de subir las imágenes con las características y propiedades óptimas y el que acabe publicando la entrada cuando corresponda.</p>\n<!-- /wp:paragraph -->', 'Entrada dun colaborador', '', 'trash', 'open', 'open', '', '__trashed', '', '', '2021-07-20 20:06:00', '2021-07-20 20:06:00', '', 0, 'http://eutamen.gal/?p=49', 0, 'post', '', 0),
