(264, 1, '2021-08-04 10:42:02', '2021-08-04 10:42:02', '<div class=\"cli_pg_page_contaner\"><h3>Sobre esta receita</h3><div>Esta Política de cookies explica que son e como as usamos, os tipos de cookies que usamos, é dicir, a información que recompilamos mediante cookies e como se usa esa información e como controlar as preferencias das cookies. Para obter máis información sobre como usamos, almacenamos e protexemos os seus datos persoais, consulte a nosa Política de Privacidade. \r\n\r\n Pode cambiar ou retirar o seu consentimento en calquera momento da Declaración de Cookies no noso sitio web \r\n Máis información sobre quenes somos, como pode contactar connosco e como procesamos os datos persoais na nosa Política de Privacidade. \r\n O seu consentimento aplícase aos seguintes dominios:  eutamen.gal  \r\n[user_consent_state]</div><h3>What are cookies ?</h3><div>Cookies are small text files that are used to store small pieces of information. They are stored on your device when the website is loaded on your browser. These cookies help us make the website function properly, make it more secure, provide better user experience, and understand how the website performs and to analyze what works and where it needs improvement.</div><h3>How do we use cookies ?</h3><div>As most of the online services, our website uses first-party and third-party cookies for several purposes. First-party cookies are mostly necessary for the website to function the right way, and they do not collect any of your personally identifiable data.\r\n\r\nThe third-party cookies used on our website are mainly for understanding how the website performs, how you interact with our website, keeping our services secure, providing advertisements that are relevant to you, and all in all providing you with a better and improved user experience and help speed up your future interactions with our website.</div><h3>What types of cookies do we use ?</h3><div>Essential: Some cookies are essential for you to be able to experience the full functionality of our site. They allow us to maintain user sessions and prevent any security threats. They do not collect or store any personal information. For example, these cookies allow you to log-in to your account and add products to your basket, and checkout securely.\r\n\r\nStatistics: These cookies store information like the number of visitors to the website, the number of unique visitors, which pages of the website have been visited, the source of the visit, etc. These data help us understand and analyze how well the website performs and where it needs improvement.\r\n\r\nMarketing: Our website displays advertisements. These cookies are used to personalize the advertisements that we show to you so that they are meaningful to you. These cookies also help us keep track of the efficiency of these ad campaigns.\r\nThe information stored in these cookies may also be used by the third-party ad providers to show you ads on other websites on the browser as well.\r\n\r\nFunctional: TThese are the cookies that help certain non-essential functionalities on our website. These functionalities include embedding content like videos or sharing content of the website on social media platforms.\r\n\r\nPreferences: These cookies help us store your settings and browsing preferences like language preferences so that you have a better and efficient experience on future visits to the website.\r\n[cookie_audit columns=\"cookie,description\" heading=\"The below list details the cookies used in our website.\"]</div><h3>How can I control the cookie preferences ?</h3><div>Should you decide to change your preferences later through your browsing session, you can click on the \"Privacy &amp; Cookie Policy\" tab on your screen. This will display the consent notice again enabling you to change your preferences or withdraw your consent entirely.\r\n\r\nIn addition to this, different browsers provide different methods to block and delete cookies used by websites. You can change the settings of your browser to block/delete the cookies. To find out more about how to manage and delete cookies, visit wikipedia.org, www.allaboutcookies.org.</div></div>', 'Política de Cookies', '', 'trash', 'closed', 'closed', '', 'politica-de-cookies__trashed', '', '', '2021-08-04 10:42:22', '2021-08-04 10:42:22', '', 0, 'http://eutamen.gal/?page_id=264', 0, 'page', '', 0),
(265, 1, '2021-08-04 10:42:02', '2021-08-04 10:42:02', '<div class=\"cli_pg_page_contaner\"><h3>Sobre esta receita</h3><div>Esta Política de cookies explica que son e como as usamos, os tipos de cookies que usamos, é dicir, a información que recompilamos mediante cookies e como se usa esa información e como controlar as preferencias das cookies. Para obter máis información sobre como usamos, almacenamos e protexemos os seus datos persoais, consulte a nosa Política de Privacidade. \r\n\r\n Pode cambiar ou retirar o seu consentimento en calquera momento da Declaración de Cookies no noso sitio web \r\n Máis información sobre quenes somos, como pode contactar connosco e como procesamos os datos persoais na nosa Política de Privacidade. \r\n O seu consentimento aplícase aos seguintes dominios:  eutamen.gal  \r\n[user_consent_state]</div><h3>What are cookies ?</h3><div>Cookies are small text files that are used to store small pieces of information. They are stored on your device when the website is loaded on your browser. These cookies help us make the website function properly, make it more secure, provide better user experience, and understand how the website performs and to analyze what works and where it needs improvement.</div><h3>How do we use cookies ?</h3><div>As most of the online services, our website uses first-party and third-party cookies for several purposes. First-party cookies are mostly necessary for the website to function the right way, and they do not collect any of your personally identifiable data.\r\n\r\nThe third-party cookies used on our website are mainly for understanding how the website performs, how you interact with our website, keeping our services secure, providing advertisements that are relevant to you, and all in all providing you with a better and improved user experience and help speed up your future interactions with our website.</div><h3>What types of cookies do we use ?</h3><div>Essential: Some cookies are essential for you to be able to experience the full functionality of our site. They allow us to maintain user sessions and prevent any security threats. They do not collect or store any personal information. For example, these cookies allow you to log-in to your account and add products to your basket, and checkout securely.\r\n\r\nStatistics: These cookies store information like the number of visitors to the website, the number of unique visitors, which pages of the website have been visited, the source of the visit, etc. These data help us understand and analyze how well the website performs and where it needs improvement.\r\n\r\nMarketing: Our website displays advertisements. These cookies are used to personalize the advertisements that we show to you so that they are meaningful to you. These cookies also help us keep track of the efficiency of these ad campaigns.\r\nThe information stored in these cookies may also be used by the third-party ad providers to show you ads on other websites on the browser as well.\r\n\r\nFunctional: TThese are the cookies that help certain non-essential functionalities on our website. These functionalities include embedding content like videos or sharing content of the website on social media platforms.\r\n\r\nPreferences: These cookies help us store your settings and browsing preferences like language preferences so that you have a better and efficient experience on future visits to the website.\r\n[cookie_audit columns=\"cookie,description\" heading=\"The below list details the cookies used in our website.\"]</div><h3>How can I control the cookie preferences ?</h3><div>Should you decide to change your preferences later through your browsing session, you can click on the \"Privacy &amp; Cookie Policy\" tab on your screen. This will display the consent notice again enabling you to change your preferences or withdraw your consent entirely.\r\n\r\nIn addition to this, different browsers provide different methods to block and delete cookies used by websites. You can change the settings of your browser to block/delete the cookies. To find out more about how to manage and delete cookies, visit wikipedia.org, www.allaboutcookies.org.</div></div>', 'Política de Cookies', '', 'inherit', 'closed', 'closed', '', '264-revision-v1', '', '', '2021-08-04 10:42:02', '2021-08-04 10:42:02', '', 264, 'http://eutamen.gal/?p=265', 0, 'revision', '', 0),
(266, 1, '2021-08-04 10:48:44', '2021-08-04 10:48:44', '<div class=\"cli_pg_page_contaner\"><h3>Sobre esta receita</h3><div>Esta Política de Cookies explica que son e como as usamos, os tipos de cookies que usamos, é dicir, a información que recompilamos mediante cookies e como se usa esa información e como controlar as preferencias das cookies. Para obter máis información sobre como usamos, almacenamos e protexemos os seus datos persoais, consulte a nosa Política de Privacidade. \r\n\r\n Pode cambiar ou retirar o seu consentimento en calquera momento da Declaración de Cookies no noso sitio web \r\n Máis información sobre quen somos, como pode contactar connosco e como procesamos os datos persoais na nosa Política de Privacidade. \r\n O seu consentimento aplícase aos seguintes dominios:  eutamen.gal  \r\n[user_consent_state]</div><h3>Que son as galletas?</h3><div>As cookies son pequenos ficheiros de texto que se usan para almacenar pequenas informacións. Gárdanse no seu dispositivo cando o sitio web se carga no seu navegador. Estas cookies axúdannos a que o sitio web funcione correctamente, o faga máis seguro, a proporciona unha mellor experiencia de usuario e ao comprender o rendemento do sitio web e analizar o que funciona e onde precisa mellorar.</div><h3>Como funcionan as galletas?</h3><div>Como a maioría dos servizos en liña, o noso sitio web usa cookies propias e de terceiros para varios fins. As cookies propias son principalmente necesarias para que o sitio web funcione correctamente e non recollen ningún dos seus datos de identificación persoal. \r\n\r\n As cookies de terceiros empregadas no noso sitio web son principalmente para comprender o rendemento do sitio web, como interactúa co noso sitio web, manter os nosos servizos seguros, ofrecer anuncios que sexan relevantes para vostede e, en definitiva, proporcionarlle un mellor servizo. e mellora da experiencia do usuario e axuda a acelerar as túas futuras interaccións co noso sitio web.</div><h3>Que tipo de galletas están dispoñibles?</h3><div>Esencial: Algunhas cookies son esenciais para que poida experimentar a plena funcionalidade do noso sitio. Permítennos manter sesións de usuario e evitar calquera ameaza á seguridade. Non recollen nin almacenan ningunha información persoal. Por exemplo, estas cookies permítenche iniciar sesión na túa conta e engadir produtos á túa cesta e realizar a compra de forma segura.\r\n\r\nEstatísticas: Estas cookies almacenan información como o número de visitantes ao sitio web, o número de visitantes únicos, as páxinas do sitio web visitadas, a fonte da visita, etc. Estes datos axúdannos a comprender e analizar o bo funcionamento do sitio web e onde precisa mellora.\r\n\r\nComercio: O noso sitio web amosa anuncios. Estas cookies úsanse para personalizar os anuncios que lle mostramos para que sexan significativos para vostede. Estas cookies tamén nos axudan a controlar a eficiencia destas campañas publicitarias. \r\n A información almacenada nestas cookies tamén pode ser empregada por terceiros proveedores de anuncios para mostrarche anuncios noutros sitios web no navegador. \r\n\r\nFuncional: Estas son as cookies que axudan a certas funcionalidades non esenciais no noso sitio web. Estas funcións inclúen incrustar contido como vídeos ou compartir contido do sitio web en plataformas de redes sociais. \r\n\r\n\r\nPreferencias: Estas cookies axúdannos a almacenar a súa configuración e preferencias de navegación como as preferencias de idioma para que teña unha experiencia mellor e eficiente en futuras visitas ao sitio web. \r\n[cookie_audit columns = \"cookie, description\" heading = \"A seguinte lista detalla as cookies empregadas no noso sitio web.\"]</div><h3>Como se controlan as preferencias de cookies?</h3><div>Se decides cambiar as túas preferencias máis tarde a través da túa sesión de navegación, podes facer clic na pestana \"Privacidade e política de cookies\" da pantalla. Isto amosará de novo o aviso de consentimento que lle permitirá cambiar as súas preferencias ou retiralo por completo. \r\n\r\n Ademais, diferentes navegadores proporcionan diferentes métodos para bloquear e eliminar as cookies empregadas polos sitios web. Pode cambiar a configuración do seu navegador para bloquear / eliminar as cookies. Para saber máis sobre como xestionar e eliminar as cookies, visite wikipedia.org, www.allaboutcookies.org.</div></div>', 'Política de Galletas', '', 'publish', 'closed', 'closed', '', 'politica-de-galletas', '', '', '2021-08-04 10:48:44', '2021-08-04 10:48:44', '', 0, 'http://eutamen.gal/?page_id=266', 0, 'page', '', 0),
