(30, 30, 'cookielawinfo-category', 'As cookies necesarias son absolutamente esenciais para que o sitio web funcione correctamente. Estas cookies garanten as funcións básicas e as funcións de seguridade do sitio web de forma anónima.\r\n[cookie_audit category=\"necessary\" style=\"winter\" columns=\"cookie,duration,description\"]', 0, 6),
(31, 31, 'cookielawinfo-category', 'As cookies funcionais axudan a realizar certas funcionalidades como compartir o contido do sitio web en plataformas de redes sociais, recompilar comentarios e outras funcións de terceiros.\r\n[cookie_audit category=\"functional\" style=\"winter\" columns=\"cookie,duration,description\"]', 0, 0),
(32, 32, 'cookielawinfo-category', 'As cookies de rendemento úsanse para comprender e analizar os índices clave de rendemento do sitio web, o que axuda a ofrecer unha mellor experiencia de usuario aos visitantes.\r\n[cookie_audit category=\"performance\" style=\"winter\" columns=\"cookie,duration,description\"]', 0, 0),
(33, 33, 'cookielawinfo-category', 'As cookies analíticas úsanse para comprender como os visitantes interactúan co sitio web. Estas cookies axudan a proporcionar información sobre métricas, o número de visitantes, a taxa de rebote, a fonte de tráfico, etc.\r\n[cookie_audit category=\"analytics\" style=\"winter\" columns=\"cookie,duration,description\"]', 0, 0),
(34, 34, 'cookielawinfo-category', 'As cookies publicitarias úsanse para proporcionar aos visitantes anuncios e campañas de mercadotecnia relevantes. Estas cookies fan un seguimento dos visitantes de sitios web e recollen información para ofrecer anuncios personalizados.\r\n[cookie_audit category=\"advertisement\" style=\"winter\" columns=\"cookie,duration,description\"]', 0, 0),
(35, 35, 'cookielawinfo-category', 'Outras cookies sen categorizar son as que se están a analizar e aínda non se clasificaron nunha categoría.\r\n[cookie_audit category=\"others\" style=\"winter\" columns=\"cookie,duration,description\"]', 0, 0);
