INSERT INTO `wp_wfissues` (`id`, `time`, `lastUpdated`, `status`, `type`, `severity`, `ignoreP`, `ignoreC`, `shortMsg`, `longMsg`, `data`) VALUES
(1, 1628169167, 1628169167, 'new', 'wafStatus', 100, '05bb5677cd06ca8ab34749c87f936281', '114d3f6cc78099138c7197127bcd170f', 'Web Application Firewall is disabled', 'Wordfence\'s Web Application Firewall has been unexpectedly disabled. If you see a notice at the top of the Wordfence admin pages that says \"The Wordfence Web Application Firewall cannot run,\" click the link in that message to rebuild the configuration. If this does not work, you may need to fix file permissions. <a href=\"https://www.wordfence.com/help/?query=scan-result-waf-disabled\" target=\"_blank\" rel=\"noopener noreferrer\">More Details</a>', 'a:2:{s:9:\"wafStatus\";s:8:\"disabled\";s:16:\"wafStatusDisplay\";s:8:\"Disabled\";}'),
(2, 1628169168, 1628169168, 'new', 'skippedPaths', 25, '6fd0d290b978eab8027e6b79501ac149', '6fd0d290b978eab8027e6b79501ac149', '1 path was skipped for the malware scan due to scan settings', 'The option \"Scan files outside your WordPress installation\" is off by default, which means 1 path and its file(s) will not be scanned for malware or unauthorized changes. To continue skipping this path, you may ignore this issue. Or to start scanning it, enable the option and subsequent scans will include it. Some paths may not be necessary to scan, so this is optional. <a href=\"https://www.wordfence.com/help/?query=scan-result-skipped-paths\" target=\"_blank\" rel=\"noopener noreferrer\">Learn More</a><br><br>The path skipped is ~/.git', 'a:0:{}'),
(3, 1628169211, 1628169211, 'new', 'knownfile', 25, '6b8a86c1e0f0d37331a598568303c29f', 'f7e4d68e3fdadec79766b98c63f6dc37', 'Old WordPress core file not removed during update: wp-includes/css/dist/editor/editor-styles.css', 'This file is in a WordPress core location but is from an older version of WordPress and not used with your current version. Hosting or permissions issues can cause these files to get left behind when WordPress is updated and they should be removed if possible.', 'a:5:{s:4:\"file\";s:45:\"wp-includes/css/dist/editor/editor-styles.css\";s:5:\"cType\";s:4:\"core\";s:7:\"canDiff\";b:0;s:6:\"canFix\";b:0;s:9:\"canDelete\";b:1;}'),
(4, 1628169211, 1628169211, 'new', 'knownfile', 25, 'e1ca2e5ea41b5dafe3063c5d1435886c', 'd3ab2d8a318d39f09b1512309ccbc55f', 'Old WordPress core file not removed during update: wp-includes/css/dist/editor/editor-styles.min.css', 'This file is in a WordPress core location but is from an older version of WordPress and not used with your current version. Hosting or permissions issues can cause these files to get left behind when WordPress is updated and they should be removed if possible.', 'a:5:{s:4:\"file\";s:49:\"wp-includes/css/dist/editor/editor-styles.min.css\";s:5:\"cType\";s:4:\"core\";s:7:\"canDiff\";b:0;s:6:\"canFix\";b:0;s:9:\"canDelete\";b:1;}'),
(5, 1628169211, 1628169211, 'new', 'knownfile', 25, '42d3b8e466048315341f9bab1a6cf7d1', 'e2aa4fed6ce5ca5897eb8393ac0256a6', 'Old WordPress core file not removed during update: wp-includes/css/dist/editor/editor-styles-rtl.css', 'This file is in a WordPress core location but is from an older version of WordPress and not used with your current version. Hosting or permissions issues can cause these files to get left behind when WordPress is updated and they should be removed if possible.', 'a:5:{s:4:\"file\";s:49:\"wp-includes/css/dist/editor/editor-styles-rtl.css\";s:5:\"cType\";s:4:\"core\";s:7:\"canDiff\";b:0;s:6:\"canFix\";b:0;s:9:\"canDelete\";b:1;}'),
(6, 1628169211, 1628169211, 'new', 'knownfile', 25, 'cc32ece7a4b5ae4d279934589e2324f4', '642f1f89465684214ca76f5aaffd8275', 'Old WordPress core file not removed during update: wp-includes/css/dist/editor/editor-styles-rtl.min.css', 'This file is in a WordPress core location but is from an older version of WordPress and not used with your current version. Hosting or permissions issues can cause these files to get left behind when WordPress is updated and they should be removed if possible.', 'a:5:{s:4:\"file\";s:53:\"wp-includes/css/dist/editor/editor-styles-rtl.min.css\";s:5:\"cType\";s:4:\"core\";s:7:\"canDiff\";b:0;s:6:\"canFix\";b:0;s:9:\"canDelete\";b:1;}');
